class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        dct = {}
        for x in xrange(len(t)):
            if t[x] not in dct:
                dct[t[x]] = []
            dct[t[x]].append(x)

        #print dct
        cur = -1
        for one in s:
            if one not in dct:
                return False
            next = -1
            for idx in dct[one]:
                if idx > cur:
                    next = idx; break
            if next == -1:
                return False
            cur = next

        return True

